import React from "react";
import { NavLink } from "react-router-dom";
export default function Navpar() {
  return (
    <div>
      <div>
        <a>
          <NavLink end to={"/"}>
            Home
          </NavLink>
        </a>
        <NavLink to={"/about"}>About</NavLink>
        <NavLink to={"/tail"}>TailWind</NavLink>
      </div>
    </div>
  );
}
